    def forward(self, x):
        # print(PVNetwork.out_mat)
        ys = []
        for idx in range(192):
            m = Features.idxes[idx][7]
            input = x[:,idx:idx+1,:]
            output = self.blocks[m](input)
            ys.append(output)

        z = torch.cat(tuple(ys), dim=2)
        z = z.squeeze()
        z = torch.matmul(z, PVNetwork.out_mat)

        # policyとvalueを分ける
        p, v = torch.split(z, [81, 1], dim=1)
        return p, v

    def __init__(self):
        super(PVNetwork, self).__init__()
        blocks = [Block() for _ in range(6)]
        self.blocks = nn.ModuleList(blocks)
        self.out = nn.Linear(in_features=192 * 5, out_features=82)
        
    def get_linear_params(self, linear):
        param = struct.pack("<f", linear.weight.nelement())
        for val in linear.weight.data.flatten().tolist():
            param += struct.pack("<f", val)
        param += struct.pack("<f", linear.bias.nelement())
        for val in linear.bias.data.flatten().tolist():
            param += struct.pack("<f", val)
        return param

    def get_parameter_string(self):
        # C++モデル用のバイナリを出力する
        params = bytes()
        print(len(params))

        for idx in range(6):
            params += self.get_linear_params(self.blocks[idx].linear1)
            params += self.get_linear_params(self.blocks[idx].linear2)
            params += self.get_linear_params(self.blocks[idx].linear3)
            params += self.get_linear_params(self.blocks[idx].out)

        print(len(params))
        return base64.b64encode(params).decode()